import gql from "graphql-tag";

const GET_BOOKS = gql`
{
    getNotes {
        title
        content
        author
        place
    }
}`;

const CREATE_NOTE = gql`
  mutation create_note($title: String!, $content: String!,$author: String!, $place: String!) {
    post(title: $title, content: $content, author:$author, place:$place) {
      id
      createdAt
      url
      description
    }
  }`

export default GET_BOOKS;
